import React, { useState } from "react";
import { Questions } from "./api";


const Interview = () => {
    const [val, setVal] = useState(Questions)
    return (
        <>
            {
                val.map((e) => {
                    const {id,...Questions} = e 
                    return (
                        <>
                            <div>
                                <button>+</button>
                                <h1>{e.Q} </h1>
                            </div>
                            <div>{e.A}</div>
                        </>
                    )

                })
            }
        </>
    )
}

export default Interview;
